требований  к  участникам  отбора  в  соответствии  с  пунктом  5  и  подпунктом  "б"  пункта  7
настоящих  Правил  и  перечня  документов,  представляемых  участниками  отбора  для  подтверждения  их
соответствия указанным требованиям в соответствии с пунктом 8 настоящих Правил;
порядка  подачи  заявок  на  участие  в  отборе  участниками  отбора,  требований,  предъявляемых  к
форме и содержанию заявок на участие в отборе, в соответствии с пунктом 8 настоящих Правил;
порядка  отзыва  заявок  на  участие  в  отборе,  порядка  их  возврата,  определяющего  в  том  числе
основания для их возврата, порядка внесения изменений в заявки на участие в отборе;
правил рассмотрения заявок на участие в отборе в соответствии с пунктом 9 настоящих Правил;
порядка  предоставления  участникам  отбора  разъяснений  положений  объявления  о  проведении
отбора, даты начала и даты окончания срока предоставления таких разъяснений;
срока, в течение которого участник отбора, прошедший отбор, должен подписать соглашение о
предоставлении субсидии;
условий  признания  участника  отбора,  прошедшего  отбор,  уклонившимся  от  заключения
соглашения о предоставлении субсидии;
даты размещения результатов отбора на едином портале, которая не может быть позднее 14-го
календарного дня, следующего за днем признания участника отбора прошедшим отбор.

Дополнительно к положениям, указанным в пункте 6 настоящих требований, не допускается
расходование  средств,  полученных  за  счет  льготного  кредита  по  ставке,  составляющей  не  более  3
процентов годовых:
а) на осуществление стимулирующих выплат, не входящих в расчет фонда заработной платы;
б) на оплату транспортных расходов, не связанных с производственной деятельностью;
в) на выплату дивидендов;
г) на уплату обязательных платежей в бюджеты бюджетной системы Российской Федерации, по
которым предусмотрена отсрочка платежей или не наступили сроки уплаты;
д)  на  аренду  помещений  и  оборудования,  сервисное  обслуживание  оборудования,  не
участвующего в производственной деятельности заемщика;
е)  на  рефинансирование  ранее  полученных  кредитов  и  займов,  в  том  числе  на  погашение
обязательств  заемщика  перед  кредитной  организацией  и  третьими  лицами  по  полученным  от  них
кредитам и (или) займам, включая уплату процентов, комиссий и неустоек;
ж) на предоставление займов третьим лицам;
з)  на  оплату  топливно-энергетических  ресурсов,  не  связанных  с  производственной
деятельностью;
и)  на  приобретение  векселей  или  эмиссионных  ценных  бумаг,  осуществление  вложений  в
уставные капиталы других юридических лиц (включая покупку акций на вторичном рынке);
к) на валютные операции, не связанные с реализацией проектов;
л)  на  пополнение  расчетного  счета  заемщика,  открытого  в  иной  кредитной  организации,  за
исключением  пополнения  расчетных  счетов  заемщика,  открытых  в  иных  кредитных  организациях,  в
целях:
расчетов с зарубежными поставщиками (в том числе в иностранной валюте) в течение 5 рабочих
дней;
выплаты заработной платы заемщиком.
